goeie film

met Kevin Sorbo, Yvette Nipar en Jennifer Sipes

Na het &quot;schoonmaken&quot; van zijn stad als plaatselijke sheriff, neemt Nick ontslag en reist naar Dallas om een nieuwe leven te beginnen met een FBI-agente en haar twaalf jarige dochter. Wanneer een meedogenloze drugbaron enkele hoofdgetuigen van de FBI wilt uitschakelen, komt Nick in het midden van een bendeoorlog terecht. Als niemand Nick wilt helpen is hij genoodzaakt om de recht in zijn eigen handen te nemen en begint hij een gevecht om voorgoed een punt achter te criminele activiteiten van de drugsbaron te zetten.:
